// import logo from './logo.svg';
import React, { Component } from 'react'
import './App.css';
import Navbar from './Compents/Navbar';
import News from './Compents/News';
// import LoadingBar from 'react-top-loading-bar'
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
      <Navbar/>
      <Switch>
          <Route exact path="/">
          <News setProgressBar={this.setProgressBar}key="general" pageSize={10} country='in' category="general"/>
          </Route>
          <Route exact path="/business">
          <News setProgressBar={this.setProgressBar}key="business" pageSize={10} country='in' category="business"/>
          </Route>
          <Route exact path="/entertainment">
          <News setProgressBar={this.setProgressBar}key="entertainment" pageSize={10} country='in' category="entertainment"/>
          </Route>
          <Route exact path="/general">
          <News setProgressBar={this.setProgressBar}key="general" pageSize={10} country='in' category="general"/>
          </Route>
          <Route exact path="/health">
          <News setProgressBar={this.setProgressBar}key="health" pageSize={10} country='in' category="health"/>
           </Route>
           <Route exact path="/science">
           <News setProgressBar={this.setProgressBar}key="science" pageSize={10} country='in' category="science"/>
           </Route>
           <Route exact path="/sports">
           <News setProgressBar={this.setProgressBar}key="sports" pageSize={10} country='in' category="sports"/>
           </Route>
           <Route exact path="/technology">
           <News setProgressBar={this.setProgressBar}key="technology" pageSize={10} country='in' category="technology"/>
           </Route>
        </Switch>
      </Router>
      </div>
    )
  }
}
